import styled from 'styled-components'
import { colors, fonts } from '../../utils/style/variables'

const Header = styled.h1`
    text-align: center;
    font-family: ${fonts.header};
    background-color: ${colors.light_background};
`

function Home() {
    return (
        <Header>
            <div className="home-wrapper">
                <h1>COOK BOOK</h1>

            </div>
        </Header>
    );
  }

  export default Home;
